import React, { Component } from "react";
import linkedInIcon from "../../images/linkedInIcon.png";
import linkedInPink from "../../images/linkedInIconPink.png";
import github from "../../images/githubIcon.png";
import githubPink from "../../images/githubIconPink.png";
import twitter from "../../images/twitterIcon.png";
import twitterPink from "../../images/twitterIconPink.png";
import "./footer.css";

class Footer extends Component {


  render() {
  return (
    <div id="footer" uk-sticky="bottom: #footerStop">
      <div className="footerText">
        &copy; 2020 Elizabeth Regas
        <a href="https://www.linkedin.com/in/elizaregas/" target="_blank" rel="noopener noreferrer">
          <img 
            src={linkedInIcon} 
            alt="linkedIn icon" 
            className="linkedInIcon icons"
            onMouseOver={e => console.log(e)}
          />
        </a>
        <a href="https://github.com/ElizaRegas" target="_blank" rel="noopener noreferrer">
          <img src={github} alt="github icon" className="icons" />
        </a>
        <a href="https://twitter.com/elizaregas" target="_blank" rel="noopener noreferrer">
          <img src={twitter} alt="twitter icon" className="icons" />
        </a>
      </div>
      <div id="footerStop"></div>
    </div>
  )
  };
};

export default Footer;
